import React from 'react';
import Gallery from '../components/Gallery';
import '../styles/pages.css';

const GalleryPage = () => {
  return (
    <div className="page-container">
      <div className="page-content">
        <h1>Our Work</h1>
        <p className="page-intro">
          Browse through our portfolio of successful events and team-building experiences. Each event is uniquely crafted to meet our clients' specific needs and objectives.
        </p>
        <div className="gallery-section">
          <Gallery fullPage={true} />
        </div>
        <div className="cta-section">
          <h2>Inspired by what you see?</h2>
          <p>Let's create something amazing together for your next event.</p>
          <a href="/contact" className="cta-button">Start Planning</a>
        </div>
      </div>
    </div>
  );
};

export default GalleryPage;
